import React, { Component } from 'react'
import Imga from "../images/1.jpg"

export default class Student extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         username:"",
         password:""
      };
    };
    
    handlechange=(e)=>{
        this.setState({
        username:e.target.value,
        password:e.target.value
        })
    }

    handlesubmit=(e)=>{
        e.preventDefault()
        console.log(this.state)
    }
    render() {
        return (
            <div>
      

                 <div className="cmd">
                 
            <label><h2>Student login</h2></label>
            <form onSubmit={this.handlesubmit}>
                <input type="text" id="username" placeholder="Username" required onChange={this.handlechange} /><br />

                <input type="password" id="password" name="password" placeholder="Password" required onChange={this.handlechange} /><br />

                <input type="submit" value="Login"></input>
            </form>
        </div>
 
            </div>
        )
    }
}
